                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    alumno_id: alumno_id,
                    sectorName: sectorInput.value
                })
            });
            
            if(!response.ok){
                throw new Error("Error al crear la alerta");   
            }

            const result = await response.json();
            alert(`Alerta enviada con éxito. ID: ${result.id}`);
        } catch (error) {
            console.log("Error: ", error);
        }
    }
</script>

